import React, { Component } from 'react'
import WelcomeComponent from './WelcomeComponent'
import AuthContent from './AuthContent'
import LoginForm from './LoginForm'

export default class AppContent extends Component {
  render() {
    return (
      <div>
        <WelcomeComponent/>
        <AuthContent/>
        <LoginForm/>
      </div>
    )
  }
}
